import string

lo = string.ascii_lowercase
up = string.ascii_uppercase

def solve(a):
	a = a.strip()
	def react(a):
		st = []
		for x in a:
			if len(st) > 0 and st[-1] == x.swapcase():
				st.pop()
			else:
				st.append(x)
		return len(st)

	print("Part 1:", react(a))
	best = len(a);
	for i in range(26):
		aa = a.replace(lo[i], "").replace(up[i], "")
		best = min(best, react(aa))
	print("Part 2:", best)

solve(
'''
dabAcCaCBAcCcaDA
'''
)

